-- Table structure for table `motor_atributes`
--

DROP TABLE IF EXISTS `motor_atributes`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `motor_atributes` (
  `id` bigint unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор строки',
  `price_type` enum('Negotiable price','Swap') CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL COMMENT 'Тип цены',
  `motor_model_id` int unsigned NOT NULL COMMENT 'Модель ТС',
  `motor_type_id` int unsigned NOT NULL COMMENT 'Тип ТС',
  `body_type` enum('Convertible','Coupe','Hatchback','MPV','Pickup','SUV','Saloon','Caravan') CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL COMMENT 'Тип кузова ТС',
  `gearbox` enum('Automatic','Manual') CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL COMMENT 'Тип трансмиссии ТС',
  `engine_size` int unsigned NOT NULL COMMENT 'Объем двигателя',
  `year` int unsigned NOT NULL COMMENT 'Год выпуска ТС',
  `motor_condition` enum('Used','New') CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL COMMENT 'Состояние ТС',
  `fuel_type` enum('Petrol','Diesel','Hybrid','LPG','Electric') CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL COMMENT 'Тип топлива ТС',
  `seats` int unsigned DEFAULT NULL COMMENT 'Кол-во мест ТС',
  `mileage` int unsigned DEFAULT NULL COMMENT 'Пробег ТС',
  `color` enum('White','Silver','Gray','Beige','Yellow','Orange','Red','Blue','Brown','Black','Green') CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Цвет ТС',
  `location_on_map` varchar(30) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Ссылка на точку на карте, координаты',
  `created_at` datetime DEFAULT CURRENT_TIMESTAMP,
  `updated_at` datetime DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`),
  KEY `motor_atributes_motor_models_id_fk` (`motor_model_id`),
  KEY `motor_atributes_motor_types_id_fk` (`motor_type_id`),
  KEY `motor_atributes_year_idx` (`year`),
  KEY `motor_atributes_body_type_idx` (`body_type`),
  CONSTRAINT `motor_atributes_motor_models_id_fk` FOREIGN KEY (`motor_model_id`) REFERENCES `motor_models` (`id`),
  CONSTRAINT `motor_atributes_motor_types_id_fk` FOREIGN KEY (`motor_type_id`) REFERENCES `motor_types` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Вторые части объявлений из категории ТС';
/*!40101 SET character_set_client = @saved_cs_client */;

