--
-- Table structure for table `real_estate_atributes`
--

DROP TABLE IF EXISTS `real_estate_atributes`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `real_estate_atributes` (
  `id` bigint unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор строки',
  `price_type` enum('Negotiable price','Swap','Auction') CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Тип цены',
  `real_estate_type_id` int unsigned NOT NULL COMMENT 'Тип недвижимости',
  `area` int unsigned NOT NULL COMMENT 'Площадь',
  `real_estate_condition` enum('Resale','Brand new','Under constraction') CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL COMMENT 'Состояние',
  `bedrooms` int NOT NULL COMMENT 'Кол-во спален',
  `bathrooms` int NOT NULL COMMENT 'Кол-во ванных комнат',
  `parking` enum('Covered','Uncovered','Non') CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL COMMENT 'Парковка',
  `furnishing` enum('Fully furnished','Semi-furnished','Unfurnished','Applinces only') CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL COMMENT 'Меблировка',
  `pool` tinyint(1) DEFAULT NULL COMMENT 'Наличие бассейна',
  `garden` tinyint(1) DEFAULT NULL COMMENT 'Наличие сада',
  `elevator` tinyint(1) DEFAULT NULL COMMENT 'Наличие лифта',
  `alarm` tinyint(1) DEFAULT NULL COMMENT 'Наличие сигнализации',
  `fireplace` tinyint(1) DEFAULT NULL COMMENT 'Наличие камина',
  `balcony` tinyint(1) DEFAULT NULL COMMENT 'Наличие балкона',
  `playroom` tinyint(1) DEFAULT NULL COMMENT 'Наличие игровой',
  `attic_loft` tinyint(1) DEFAULT NULL COMMENT 'Наличие чердака',
  `storage_room` tinyint(1) DEFAULT NULL COMMENT 'Наличие кладовки',
  `location_on_map` varchar(30) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Ссылка на точку на карте, координаты',
  `created_at` datetime DEFAULT CURRENT_TIMESTAMP,
  `updated_at` datetime DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`),
  KEY `real_estate_atributes_real_estate_types_id_fk` (`real_estate_type_id`),
  KEY `real_estate_atributes_bedrooms_idx` (`bedrooms`),
  CONSTRAINT `real_estate_atributes_real_estate_types_id_fk` FOREIGN KEY (`real_estate_type_id`) REFERENCES `real_estate_types` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Вторые части объявлений из категории Недвижимость';
/*!40101 SET character_set_client = @saved_cs_client */;

